property.value:
																	//Добавление  динамической роли "Исходящие. Создатель"
(function(){
    var outgoing = stm_document,
        currentEmployee = orgstructure.getCurrentEmployee();
    lecmPermission.grantDynamicRole(outgoing, currentEmployee, "OUTGOING_CREATOR", "LECM_BASIC_PG_Owner");
})();

																	//зарегистрировать проект
(function(){
    var outgoing = stm_document;
    regnumbers.registerProject(outgoing, "OUTGOING_PRJ_NUMBER");
    outgoing.save();
})();

																	//запуск подписания по маршруту
(function() {
    var jsonUtils = new Packages.org.springframework.extensions.webscripts.json.JSONUtils(),
        outgoing = stm_document,
        variables = jsonUtils.toJSONObject({
            documentAttachmentCategoryName: "Исходящее",
            workflowRole: "DA_SIGNER",
            workflowDefinition: "lecmSign",
            documentRef: outgoing.nodeRef,
            routeRef: outgoing.properties["lecm-document-route:routeRef"].nodeRef
        });
    routeWorkflow.startWorkflow(variables);
})();

																	//уведомить о направлении на доработку
(function(){
    var outgoing = stm_document,
        notification = outgoingStatemachine.prepareNotificationAboutRework(outgoing);
    notifications.sendNotification(notification);
})();

																	//очистить информацию о маршруте
(function() {
    var outgoing = stm_document;
    if(outgoing.hasAspect("lecm-document-route:routable")) {
        outgoing.removeAspect("lecm-document-route:routable");
        outgoing.save();
    }
})();

																	//направить на регистрацию
(function(){
    var i,
        outgoing = stm_document, //исходящий документ
        registrars = edsGlobalSettings.getRegistrars("DA_REGISTRAR", outgoing),//получение списка регистраторов по документу
        registrarsCount = registrars.length,
        notification;
    //раздаем права регистраторам
    for(i = 0; i < registrarsCount; ++i) {
        statemachine.grandDynamicRoleForEmployee(outgoing, registrars[i], "DA_REGISTRAR_DYNAMIC");
    }
    //подготавливаем уведомление
    notification = outgoingStatemachine.prepareNotificationAboutRegistration(outgoing, registrars);
    //рассылаем уведомление
    notifications.sendNotification(notification);
})();

																	//Зарегистрировать документ
(function() {
    var outgoing = stm_document;
    regnumbers.registerDocument(outgoing, "OUTGOING_DOC_NUMBER");
    outgoing.save();
})();

																	//уведомить об отправке
(function() {
    var outgoing = stm_document,
        notification = outgoingStatemachine.prepareNotificationAboutSending(outgoing);
    notifications.sendNotification(notification);
})();
